import styled from "styled-components";

export const Footer = styled.footer`
    background: #333b3e;
    color: white;
    position: fixed;
    bottom: 0;
    width: 100%;
    display: flex;
    padding: 0 10px;


`
export const TituloH4 = styled.h4`
    margin-left: 20px;
`
